import Heading from "./Heading";
import Para from "./Para";
import Yasir from "./Yasir";

function App() {
  return (
    <>
      <img src="./faheem.jpg" />
      <Heading />
      <Para />
      <Yasir />
    </>
  );
}

export default App;
